import React from 'react';
import { ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
        <View style={style.header}>
        <TouchableOpacity style={style.ProfileIcon}>
            <Text>PROFILE</Text>
        </TouchableOpacity>
        <TouchableOpacity style={style.Settings}>
        <Text>Settings</Text>
        </TouchableOpacity>

        </View>

    <View style={style.Info}>

    </View>
    
    </View>
  );
}

const styles = StyleSheet.create({
    header:{
        flexDirection:'row',
        alignContent:'space-between'
    },
  container: {
    flex: 1,
    marginTop:30,
    alignItems: 'center',
    justifyContent: 'center',
  },
});
